import React from 'react';
import { withCookies } from 'react-cookie';
import './EditingPanel.style.scss';
import { CloseCircleFilled } from '@ant-design/icons';
import PageBase from '../../../../../utilities/PageBase/PageBase';

class EditingPanel extends PageBase {
  constructor(props) {
    super(props);
    this.state = {
      isVisible: false
    }
  }

  setVisible(isVisible) {
    this.setState({ isVisible });
  }

  render() {
    return (
      <div className="product-management__supplier-dialog__editing-panel">
        <span>Edit</span>
        {this.state.isVisible ? (
          <div className="product-management__supplier-dialog__editing-panel__visibility">
            <div className="product-management__supplier-dialog__editing-panel__visibility__panel animated slideInRight">
              <div className="product-management__supplier-dialog__editing-panel__visibility__panel__header">
                <CloseCircleFilled
                  className="product-management__supplier-dialog__editing-panel__visibility__panel__header__btn-close"
                  onClick={() => this.setVisible(false)}
                />
              </div>
            </div>
          </div>
        ) : <></>}
      </div>
    )
  }
}
export default withCookies(EditingPanel);
